$(document).ready(function(){function b(){var d=$("#selected_tab").val();if(typeof(d)!=="undefined"&&d.length){$("#"+d).click()}else{$('div[id^="conf-"]:first').show()}}var a=$('div[id^="conf-"]');var c=$('li[id^="menu-"]');$('li[id^="menu-"], li[id^="menudiv-"]').click(function(){var d="conf-"+$(this).attr("id").match("^(.*)-(.*)$")[2];var e=$('div[id^="conf-"]:visible');if(e.attr("id")===d){return(false)}c.removeClass("selected");a.fadeOut("fast");$(this).addClass("selected");$("#"+d).delay(195).fadeIn("slow");$('input[name="current_tab"]').val("#"+d);$('input[name="selected_tab"]').val($(this).attr("id"))});b()});